import React from "react";
import { useNavigate } from 'react-router-dom';


function Home(){
    const navigate= useNavigate();
    return(
        <center>
            <h1>Welcome to Home Page </h1>
            <button>Logout onClick={()=>Navigate("/")}</button>
        </center>
    )
}

export default Home;
